  render() {
    return (
      <React.Fragment>
      <div className="MeterBlue" >
      <img className="Profile" src={ellie} />
      <div className="count" onClick={this.props.handleStarClick} >
      <img className="count" src={star} alt="Ellie" />
      <div className="counter" alt="Ellie">{this.props.count}</div>
      </div>
      </div>
      </React.Fragment>
    )
  }
}

